import WhatsInsideStyles from './WhatsInside.module.css';

const WhatsInside = () => {
    return (
        <div id="whats-inside" className={WhatsInsideStyles.whatsInsideRoot}>
            One for the Books is your storybook, scrapbook, and memory vault all rolled into one.
            Here's how it works:
            "Remember When" Pages: For those iconic memories that start with, "Remember when...?" Write down the stories you'll be telling for years to come.
            "Still Laughing About" Pages: For the moments that left you in tears of laughter. Years later, you'll still giggle just reading these pages.
            "I'll Always Remember" Pages: For the memories that hit your heart just right-the ones you'll carry forever.
            Photo Spaces: Your stories deserve visuals, too! Add photos, or anything that brings the memory to life.
            Friend Profiles: Because every great story has great characters-dedicate a page to the friends who made the moments so special.
            Index Pages: A custom table of contents for your stories. Add page numbers and titles as you go so you can flip right to the good stuff later.

        </div>
    );
}
export default WhatsInside;
